        <div className="underline"></div>
        {console.log({tours})}
      </div>
      <div>
        {/* {
          tours.map((tour) => {
            return <h1>Hello Tours</h1>
          })

        } */}
        {tours.map((tour) => {
          //  console.log(tour)
          return <Tour key={tour.id} {...tour}></Tour>;
        })}
      </div>
    </section>
  );
};

export default Tours;
